  14,\n\t\"tags\": [],\n\t\"title\": \"East-west current components and temperature
  profile data collected using thermistor, mooring, current meter and casts from the
  Atlantic Ocean as part of the IDOE/POLYMODE (International Decade of Ocean Exploration
  / combination of USSR POLYGON project and US MODE) from 16 December 1975 to 01 November
  1977 (NODC Accession 8000270)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-09-26T20:45:05.472376\",\n\t\"name\": \"east-west-current-components-and-temperature-profile-data-collected-using-thermistor-mooring-cu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"East-west current components and temperature
  profile data were collected using thermistor, mooring, and current meter casts from
  December 16, 1975 to November 1, 1977. Data were submitted by Woods Hole Oceanographic
  Institution as part of the IDOE/POLYMODE (International Decade of Ocean Exploration
  / combination of USSR POLYGON project). Data has been processed by NODC to the NODC
  standard F015-Current Meter Data Components format. The full format description
  can be found in http://www.nodc.noaa.gov/General/NODC-Archive/f015.html.nnThe F015
  format is used for time series measurements of ocean currents. These data are obtained
  from current meter moorings and represent Eulerian method of current measurement,
  i.e., the meters are deployed at a fixed point and measure flow past a sensor. Position,
  bottom depth, sensor depth, and meter characteristics are reported for each station.
  The data record comprises values of east-west (u) and north-south (v) current vector
  components at specified date and time. Current direction is defined as the direction
  toward which the water is flowing with positive directions east and north and negative
  directions west and south. Data values may be subject to averaging or filtering
  and are typically reported at 10-15 minute time intervals. Water temperature, pressure,
  and conductivity or salinity may also be reported. A text record is available for
  optional comments.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
